import Hero from "./components/Hero/Hero";

function App() {
  return (
    <>
      <Router>
        <Navbar />
          <Switch>
        <Hero />
        <div className="content">
          <Slide />
        </div>
          </Switch>
      </Router>
    </>
  );
}

export default App;
